    #region Start, Update

    public void Start()
    {
        if (instance != null) { throw new Exception("YourBalance singleton was already set"); }
        instance = this;

        harmony = new Harmony(harmonyID);
        harmony.PatchAll(Assembly.GetExecutingAssembly());

        gameDefaults["normalSpeed"] = 3f;
        gameDefaults["sprintSpeed"] = 6f;
        gameDefaults["swimSpeed"] = 2f;
        gameDefaults["jumpSpeed"] = 8f;
        gameDefaults["oxygenLostPerSecond"] = 1f;

        StartCoroutine(LoadBundle());

        if (SceneManager.GetActiveScene().isLoaded && SceneManager.GetActiveScene().name == Raft_Network.GameSceneName)
            WorldEvent_WorldLoaded();

        Debug.Log(modPrefix + "loaded!");
    }

    public void Update()
    {
        if (RAPI.GetLocalPlayer() == null || !RAPI.GetLocalPlayer().IsLocalPlayer) return;
        if (YBUI == null) return;

        if (!ShowMenu) return;
        if (Input.GetKeyDown(KeyCode.Escape))
            ShowUI(false);
    }

    #endregion Start, Update

    #region Events

    public void OnModUnload()
    {
        StopAllCoroutines();
        if (SceneManager.GetActiveScene().isLoaded && SceneManager.GetActiveScene().name == Raft_Network.GameSceneName)
        {
            StartCoroutine(DelayedUnload());
            return;
        }
        if (bundle != null)
            bundle.Unload(true);
        Debug.Log(modPrefix + "unloaded!");
        harmony.UnpatchAll(harmonyID);
        Destroy(gameObject);
    }

    public void OnLeaveGame()
    {
        StartCoroutine(DelayedUnload());
    }

    public IEnumerator DelayedUnload()
    {
        settings = new ModSettings();
        yield return StartCoroutine(ForceSettings());
        if (bundle != null)
            bundle.Unload(true);
        Debug.Log(modPrefix + "unloaded!");
        harmony.UnpatchAll(harmonyID);
        Destroy(gameObject);
        yield break;
    }

    public override void WorldEvent_WorldLoaded()
    {
        if (RAPI.GetLocalPlayer() == null || !RAPI.GetLocalPlayer().IsLocalPlayer) return;

        // Refresh components
        network = ComponentManager<Raft_Network>.Value;
        personController = RAPI.GetLocalPlayer().PersonController;

        // Refresh item lists
        defaultStackSizes = new Dictionary<int, int>();
        defaultMaxUses = new Dictionary<int, int>();
        List<Item_Base> allItems = ItemManager.GetAllItems();
        stackables = new List<Item_Base>();
        foreach (Item_Base item in allItems)
        {
            if (item.settings_Inventory.Stackable)
            {
                defaultStackSizes.Add(item.UniqueIndex, item.settings_Inventory.StackSize);
                stackables.Add(item);
            }
            else if (item.MaxUses > 1)
            {
                if (item.settings_equipment.EquipType != EquipSlotType.None)
                    defaultMaxUses.Add(item.UniqueIndex, item.MaxUses);
            }
        }

        // Refresh and apply settings
        LoadSettings();
        StartCoroutine(ForceSettings(3));
    }

