    private IEnumerator LoadBundle()
    {
        // Load Bundle
        AssetBundleCreateRequest request = AssetBundle.LoadFromMemoryAsync(Convert.FromBase64String(embeddedAssetBundle.data));
        yield return request;
        bundle = request.assetBundle;

        var loadAsset = bundle.LoadAssetAsync<GameObject>("YBUI");
        yield return loadAsset.isDone;

        YBUI = (GameObject)Instantiate(loadAsset.asset, gameObject.transform);
        MainCanvas = YBUI.GetComponentInChildren<Canvas>();

        // UI SETUP

        // Sliders
        foreach (Slider slider in MainCanvas.GetComponentsInChildren<Slider>())
        {
            if (slider.gameObject.name.Length >= "Slider_".Length)
            {
                if (sliders.Contains(slider.gameObject.name.Substring("Slider_".Length)))
                {
                    slider.gameObject.AddComponent<UpdateSliderValue>();
                    UI_sliders.Add(slider.gameObject.name.Substring("Slider_".Length), slider);
                    continue;
                }
            }
            slider.enabled = false;
        }

        // Toggles
        foreach (Toggle toggle in MainCanvas.GetComponentsInChildren<Toggle>())
        {
            if (toggle.gameObject.name.StartsWith("Toggle_"))
            {
                UI_toggles.Add(toggle.gameObject.name.Substring("Toggle_".Length), toggle);
                continue;
            }
            else if (toggle.gameObject.name.StartsWith("Btn_gm_"))
            {
                UI_gmButtons.Add(toggle.gameObject.name.Substring("Btn_gm_".Length), toggle);
                continue;
            }
            toggle.enabled = false;
        }

        // Close button
        MainCanvas.GetComponentsInChildren<Button>().Where(x => x.name == "Btn_Game_FillBars").FirstOrDefault().onClick.AddListener(FillHealthHungerThirst);
        MainCanvas.GetComponentsInChildren<Button>().Where(x => x.name == "Btn_Close").FirstOrDefault().onClick.AddListener(delegate { ToggleUI(null); });
    }

    public void RefreshUI()
    {
        foreach (KeyValuePair<string, Slider> kvp in UI_sliders)
        {
            kvp.Value.value = GetSliderSetting(kvp.Key);
        }
        foreach (KeyValuePair<string, Toggle> kvp in UI_toggles)
        {
            kvp.Value.isOn = GetToggleSetting(kvp.Key);
        }
        foreach (KeyValuePair<string, Toggle> kvp in UI_gmButtons)
        {
            kvp.Value.isOn = (GameModeValueManager.GetCurrentGameModeValue().gameMode.ToString() == kvp.Key);
        }
    }

