    #region Show/Toggle

    [ConsoleCommand(name: "ybmenu", docs: "Toggles on/off YourBalance's mod menu.")]
    public static string ToggleUI(string[] args)
    {
        if (SceneManager.GetActiveScene().isLoaded && SceneManager.GetActiveScene().name != Raft_Network.GameSceneName)
            return modPrefix + "Menu can only be used in-world";
        if (!Raft_Network.IsHost)
            return modPrefix + "Menu can only be used by the host";
        instance.ShowUI(!instance.ShowMenu);
        return modPrefix + "Menu is no" + (instance.ShowMenu ? "w" : " longer") + " visible";
    }

    public void ShowUI(bool value = false)
    {
        if (SceneManager.GetActiveScene().isLoaded && SceneManager.GetActiveScene().name != Raft_Network.GameSceneName) return;
        if (!Raft_Network.IsHost) return;
        ShowMenu = value;
        network = ComponentManager<Raft_Network>.Value;
        RAPI.ToggleCursor(value);
        if (value)
            RefreshUI();
        else
            ApplySettings();
        MainCanvas.GetComponent<CanvasGroup>().interactable = value;
        MainCanvas.GetComponent<CanvasGroup>().blocksRaycasts = value;
        MainCanvas.GetComponent<CanvasGroup>().alpha = value ? 1f : 0f;
    }

