    public void SetEquipmentDurabilityMultiplier()
    {
        Dictionary<int, int> prevMaxUses = new Dictionary<int, int>();

        // Set base items
        foreach (var kvp in defaultMaxUses)
        {
            Item_Base item = ItemManager.GetItemByIndex(kvp.Key);
            prevMaxUses.Add(item.UniqueIndex, item.MaxUses);

            int adjustedSize = (int)Math.Round(kvp.Value * (settings.i_plyEquipmentDurability / 10f));
            AccessTools.Field(typeof(Item_Base), "maxUses").SetValue(item, adjustedSize);
        };

        List<Slot> allSlots = new List<Slot>();
        allSlots.AddRange(RAPI.GetLocalPlayer().Inventory.allSlots.Where(x => x.HasValidItemInstance()));
        allSlots.AddRange(RAPI.GetLocalPlayer().Inventory.backpackSlots.Where(x => x.HasValidItemInstance()));
        allSlots.AddRange(RAPI.GetLocalPlayer().Inventory.equipSlots.Where(x => x.HasValidItemInstance()));
        foreach (var storage in StorageManager.allStorages)
            allSlots.AddRange(storage.GetInventoryReference().allSlots.Where(x => x.HasValidItemInstance()));

        // Set instantiated items
        foreach (Slot slot in allSlots)
        {
            ItemInstance item = slot.itemInstance;
            Item_Base baseItem = item.baseItem;
            if (!defaultMaxUses.ContainsKey(baseItem.UniqueIndex)) continue;

            float mult = (settings.i_plyEquipmentDurability / 10f);
            float used = (prevMaxUses[baseItem.UniqueIndex] - item.Uses);

            slot.SetUses(baseItem.MaxUses - (int)Math.Round(used));
        }
    }

    public void SetGatheringSpeedMultiplier()
    {
        GameModeValueManager.GetCurrentGameModeValue().toolVariables.removeSpeedMultiplier = (settings.i_plyGatheringSpeed / 10f);
    }

    public void SetStackSizeMultiplier()
    {
        // Set base items
        foreach (Item_Base item in stackables)
        {
            int defaultSize = defaultStackSizes[item.UniqueIndex];
            int adjustedSize = (int)Math.Round(defaultSize * (settings.i_plyStackSize / 10f));
            ItemInstance_Inventory inventory = item.settings_Inventory;
            AccessTools.Field(typeof(ItemInstance_Inventory), "stackSize").SetValue(inventory, adjustedSize);
        };

        List<Slot> allSlots = new List<Slot>();
        allSlots.AddRange(RAPI.GetLocalPlayer().Inventory.allSlots.Where(x => x.HasValidItemInstance()));
        allSlots.AddRange(RAPI.GetLocalPlayer().Inventory.backpackSlots.Where(x => x.HasValidItemInstance()));
        foreach (var storage in StorageManager.allStorages)
            allSlots.AddRange(storage.GetInventoryReference().allSlots.Where(x => x.HasValidItemInstance()));

        // Set instantiated items
        foreach (Slot slot in allSlots)
        {
            if (!slot.HasValidItemInstance()) continue;

            Item_Base item = slot.itemInstance.baseItem;
            if (!stackables.Contains(item)) continue;

            int defaultSize = defaultStackSizes[item.UniqueIndex];
            int adjustedSize = (int)Math.Round(defaultSize * (settings.i_plyStackSize / 10f));

            ItemInstance_Inventory inventory = slot.itemInstance.settings_Inventory;
            AccessTools.Field(typeof(ItemInstance_Inventory), "stackSize").SetValue(inventory, adjustedSize);
        }
    }

