    #region Load/Save

    public void LoadSettings()
    {
        Debug.Log(modPrefix + "Attempting to load settings..");
        settings = new ModSettings();

        if (File.Exists(settingsPath) && new FileInfo(settingsPath).Length > 0L)
        {
            string settingsContent = File.ReadAllText(settingsPath);
            if (settingsContent.StartsWith("v" + Version + "|"))
            {
                settings = new ModSettings(JsonUtility.FromJson<ModSettings>(settingsContent.Split('|')[1]));
                tempSettings = new ModSettings(settings);
                StartCoroutine(ForceSettings());

                Debug.Log(modPrefix + "Settings loaded!");
                FindObjectOfType<HNotify>().AddNotification(HNotify.NotificationType.normal, Name + " - Settings loaded", 3, HNotify.LoadingSprite);
                
                return;
            }
        }
        tempSettings = new ModSettings(settings);
        SaveSettings(false);
        StartCoroutine(ForceSettings());
    }

    public void SaveSettings(bool notify = true)
    {
        Debug.Log(modPrefix + "Attempting to save settings..");
        try
        {
            string serializedSettings = JsonUtility.ToJson(settings);
            File.WriteAllText(settingsPath, "v" + Version + "|" + serializedSettings);
            Debug.Log(modPrefix + "Settings saved to '" + Utils.Colorize(settingsPath, modColor) + "'");
            if (notify)
                FindObjectOfType<HNotify>().AddNotification(HNotify.NotificationType.normal, Name + " - Settings saved", 3, HNotify.CheckSprite);
        }
        catch
        {
            Debug.Log(modPrefix + Utils.Colorize("Settings were unable to be saved to file '" + settingsPath + "'", "#FF0000"));
        }
    }

    #endregion Load/Save

