    public IEnumerator ForceSettings(int delay = 0)
    {
        if (!Raft_Network.IsHost) yield break;
        yield return new WaitForSeconds(delay);

        network = ComponentManager<Raft_Network>.Value;
        personController = RAPI.GetLocalPlayer().PersonController;

        // PLAYER
        SetDamageTakenMultiplier();
        SetHealthRegenMultiplier();
        SetHungerLossMultiplier();
        SetThirstLossMultiplier();
        SetOxygenLossMultiplier();
        SetWalkingSpeedMultiplier();
        SetSprintingSpeedMultiplier();
        SetSwimmingSpeedMultiplier();
        SetJumpingSpeedMultiplier();
        SetToolDurabilityMultiplier();
        SetEquipmentDurabilityMultiplier();
        SetGatheringSpeedMultiplier();
        SetStackSizeMultiplier();
        SetFallDamageState();
        SetKeepInventoryState();
        // GAME
        SetFreeCraftsState();
        // BEAR
        SetBearDamageDealtMultiplier();
        SetBearIsTameState();
        SetBearShouldSpawnState();
        // BOAR
        SetBoarDamageDealtMultiplier();
        SetBoarIsTameState();
        SetBoarShouldSpawnState();
        // PUFFERFISH
        SetPufferfishDamageDealtMultiplier();
        SetPufferfishIsTameState();
        SetPufferfishShouldSpawnState();
        // RAT
        SetRatDamageDealtMultiplier();
        SetRatIsTameState();
        SetRatShouldSpawnState();
        // SEAGULL
        SetSeagullDamageDealtMultiplier();
        SetSeagullIsTameState();
        SetSeagullShouldSpawnState();
        SetSeagullAttacksCropsState();
        // SHARK
        SetSharkAttackRateMultiplier();
        SetSharkDamageDealtMultiplier();
        SetSharkSpawnRateMultiplier();
        SetSharkIsTameState();
        SetSharkShouldSpawnState();
        // STONEBIRD
        SetStonebirdDamageDealtMultiplier();
        SetStonebirdIsTameState();
        SetStonebirdShouldSpawnState();

        RefreshUI();
    }

    public void ApplySettings()
    {
        if (!Raft_Network.IsHost) return;

        bool changed = false;

        // GAMEMODE
