#region UI Script Components

internal class UpdateSliderValue : MonoBehaviour
{
    private Slider slider;
    private TextMeshProUGUI tmpro;

    public void Start()
    {
        slider = GetComponentInParent<Slider>();
        slider.onValueChanged.AddListener(OnValueChanged);
        tmpro = GetComponentsInChildren<TextMeshProUGUI>().Where(x => x.name == "Value").FirstOrDefault();
        tmpro.text = (slider.value / 10f).ToString() + "x";
    }

    public void OnValueChanged(float value)
    {
        tmpro.text = (value / 10f).ToString() + "x";
    }
}

#endregion UI Script Components

#region Utils

public class Utils
{
    #region Colorize

    public static string Colorize(string text, string col)
    {
        string s = string.Concat(new string[]
        {
            "<color=",
            col,
            ">",
            text,
            "</color>"
        });
        return s;
    }

    #endregion Colorize
}

